import React from "react";
import  useFetch from "../service/StudentService"; 

function FuncCard() {
    const { loading, data } = useFetch('getAll','null');
    console.log(data);
  
    return (
      <div>
        {loading && <div className="loader" />}
        {data &&
          data.length > 0 &&
          data.map(blog => <p key={blog.id}>{blog.title}</p>)}
      </div>
    );
  }

  export default FuncCard;






